import * as React from 'react';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MarketplaceScreen from '../../Pages/Marketplace/MarketplaceSreen';
import ProfileScreen from '../../Pages/Profile/ProfileScreen';
import MyEventsScreen from '../../Pages/MyEvents/MyEventsScreen';
import MyTicketScreen from '../../Pages/MyTicket/MyTicketScreen';

const Tab = createBottomTabNavigator();

const Navbar = () =>{
    return (
        <Tab.Navigator>
            <Tab.Screen name="Home" component={MarketplaceScreen} />
            <Tab.Screen name="My Events" component={MyEventsScreen} />
            <Tab.Screen name="My Tickets" component={MyTicketScreen} />
            <Tab.Screen name="Profile" component={ProfileScreen} />
            
        </Tab.Navigator>
    );
};

export default Navbar;
